			<p><strong style="font-style: italic;">Breaking News:</strong><i>&nbsp;Following&nbsp;the extensive news coverage about the planned&nbsp;ending of FogCam,&nbsp;San Francisco State University has asked to preserve and run&nbsp;it indefinitely. Please direct media inquiries to Kent Bravo, SF State Media Relations (<a href = "mailto: kentbravo@sfsu.edu">kentbravo@sfsu.edu</a>).</i></p>

			<p><strong style="font-style: italic;">Official Statement:</strong><i> San Francisco State University can confirm it has agreed to continue maintaining the FogCam, which prevents shutdown of the service. San Francisco State University has supported operation of the FogCam since its inception in 1994, a major technology milestone at the time. The University looks forward to continuing the webcam\x92s legacy.</i></p>

			<p><s><i><b>Notice:</b> After 25 years, FogCam is shutting down forever at the end of August, 2019. Webdog and Danno thank our viewers and San Francisco State University for their support over the years.&nbsp;The Internet has changed dramatically since 1994, but FogCam will always have a special place in its history.</i></s></p>

